import React, {useEffect, useState} from 'react'

export default function App(){

  const [backendData, setBackendData] = useState([{}])

  useEffect(() => {
   fetch("/api").then(
      response => response.json()
    ).then(
      data => {
        setBackendData(data)
      }
    )
  }, []); 

  return (

    <div>
      {(typeof  backendData.users === 'undefined') ? (
        <p>Cargando...</p>
      ) : (
        backendData.users.map((user,i) => (
           <p key={i}>{user}</p>
      ))
      )}
    </div>
  );
}

